import { Box, Container, Typography } from "@mui/material";

function Etusivu() {
  <Box sx={{ width: "100%", maxWidth: 500 }}>
    <Typography variant="h1" component="div" gutterBottom>
      h1. Heading
    </Typography>
  </Box>;
}

export default Etusivu;
